import React from "react";
import './Button.css'
 const Button =()=>{
    return(
        <div className="title">
            <h3>Booking Website</h3>
            <div className="btn">
                <div className="btn-register">
                    <button type="button">Register</button>
                </div>
                
                <button type="button">Login</button>
            </div>
        
        </div>
    )
 }
 export default Button
